tables.table_schema:
CREATE TABLE inventory (
    product_id UUID PRIMARY KEY,
    product_name VARCHAR(255),
    current_stock INT,
    optimal_stock INT
);

CREATE TABLE orders (
    order_id UUID PRIMARY KEY,
    product_id UUID,
    order_date TIMESTAMP,
    quantity INT
);

CREATE TABLE inventory_tracking (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(255),
    current_stock INT,
    last_replenishment_date TIMESTAMP
);

CREATE TABLE stockout_alerts (
    alert_id INT PRIMARY KEY,
    product_id INT,
    alert_message TEXT,
    alert_timestamp TIMESTAMP
);

CREATE TABLE replenishment_strategies (
    strategy_id INT PRIMARY KEY,
    product_id INT,
    reorder_quantity INT,
    lead_time_days INT
);

CREATE TABLE stockout_alerts (
  id INT PRIMARY KEY,
  product_id INT,
  alert_time TIMESTAMP,
  alert_message TEXT
);

CREATE TABLE inventory_levels (
    product_id INT PRIMARY KEY,
    quantity INT
);

CREATE TABLE stockouts (
    stockout_id INT PRIMARY KEY,
    product_id INT,
    stockout_date DATE
);

CREATE TABLE replenishment_strategies (
    strategy_id INT PRIMARY KEY,
    strategy_name VARCHAR(50),
    lead_time INT
);

CREATE TABLE products (
    product_id INT PRIMARY KEY,
    product_name VARCHAR(100),
    price DECIMAL(10, 2)
);

CREATE TABLE warehouses (
    warehouse_id INT PRIMARY KEY,
    location VARCHAR(100),
    capacity INT
);
